import {
  buildPagesLoadedLabel,
  getInitialPageToken,
  setReaction,
  useExposeDebugRef,
} from '@/demo/demoUtils'

const items = ref<FeedItem[]>([])
const masonryRef = ref<{
  remove: (itemsOrIds: Array<string | FeedItem> | string | FeedItem) => Promise<void>
} | null>(null)

